    false,nt"url": null,nt"notes": "NODC Accession 0134541 includes physical
    and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1211
    in the North Pacific Ocean on 2012-07-14. These data include CURRENT SPEED - EAST/WEST
    COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
    to collect these data include ADCP and GPS. These data were collected by Alexandra
    Hangsterfer of University of California - San Diego; Scripps Institution of Oceanography
    as part of 2012 Focus on the Future (FOTF) Student Cruise. The Lamont-Doherty Earth
    Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling
    Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
